import React from 'react';

const Cookie=()=>{

    const [cookies, setCookie, removeCookie] = useCookies(['cookie-name']);

    const cooki=()=>{
        setCookie("jai", "i am a male")
    }

    const recooki=()=>{
        removeCookie("jai");
    }

    return(
        <>
        <button onClick={cooki}>GetCookie</button>
        <button onClick={recooki}>GetCookie</button>
        </>
    );
}

export default Cookie;
